import React from 'react';
import '../../styles/Tipografias.css';
import PerfilAdmin from '../../images/PerfilAdmin.png'
import '../../styles/Cardperfil_Admin.css';


class Cardperfil extends React.Component {
    render() {
        return (
            <div className="card-deck" >
                <div className="card" id="Card">
                    <img src={PerfilAdmin} height="350" className="card-img-top" alt="..."/>
                </div>
                    <div className="card" id="Card">      
                            <div className="card-body">
                                <h5 className="card-title">Hola Santiago</h5>
                                <h5 className="card-title">Nombre:<p className="card-text" id="Card-text">Santiago Ramírez</p></h5>
                                <h5 className="card-title">Nickname:<p className="card-text">Estigma81</p></h5>
                                <h5 className="card-title">Email:<p className="card-text">santiago.ramireza@iefedericoozanam.edu.co</p></h5>
                                <h5 className="card-title">Fecha de cumpleaños:<p className="card-text">28/12/2003</p></h5>
                                <h5 className="card-title">Mascotas:<p className="card-text">Si tiene</p></h5>
                                <h5 className="card-title">Género:<p className="card-text">Masculino</p></h5>
                                
                            </div>
                    </div>
            </div>
        )
    }
}
export default Cardperfil;
